ocument cookie policyA cookie is a small simple file that is sent along with pages of this website and stored by your browser on the hard drive of your computer or another device. The information stored therein may be returned to our servers or to the servers of the relevant third parties during a subsequent visit.'=>'En cookie är en liten enkel fil som skickas tillsammans med sidor på denna webbplats och lagras av din webbläsare på din dators eller annan enhets hårddisk. Informationen som lagras däri kan returneras till våra servrar eller till relevanta tredje parters servrar under ett efterföljande besök.','Legal document cookie policyFor questions and/or comments about our Cookie Policy and this statement, please contact us by using the following contact details:'=>'För frågor och/eller kommentarer om vår cookiepolicy och denna redogörelse, vänligen kontakta oss genom följande kontaktuppgifter:','Legal document cookie policyIf you give us your consent to process your data, you have the right to revoke that consent and to have your personal data deleted.'=>'Om du ger oss ditt samtycke till att behandla dina uppgifter har du rätt att återkalla det samtycket och att få dina personuppgifter raderade.','Legal document cookie policyRight to object: you may object to the processing of your data. We comply with this, unless there are justified grounds for processing.'=>'Rätt att invända: du kan invända mot behandlingen av dina uppgifter. Vi följer detta, om det inte finns befogade skäl för behandling.','Legal document cookie policyOn this website we use advertising cookies, enabling us to personalize the advertisements for you, and we (and third parties) gain insights into the campaign results. This happens based on a profile we create based on your click and surfing on and outside %s. With these cookies you, as website visitor are linked to a unique ID, so you do not see the same ad more than once for example.'=>'På denna webbplats använder vi cookies för marknadsföring, vilket gör det möjligt för oss att anpassa annonser åt dig, och vi (och tredje part) får insikter i olika kampanjers resultat. Detta sker baserat på en profil vi skapar baserat på dina klick och surfning på och utanför %s. Med dessa cookies är du som webbplatsbesökare länkad till ett unikt ID, så att du till exempel inte ser samma annons mer än en gång.','Legal document cookie policyOur website, %s (hereinafter: "the website") uses cookies and other related technologies (for convenience all technologies are referred to as "cookies"). Cookies are also placed by third parties we have engaged. In the document below we inform you about the use of cookies on our website.'=>'Vår webbplats, %s (hädanefter: "webbplatsen") använder cookies och andra relaterade teknologier (för bekvämlighets skull kallas all teknik för "cookies"). Cookies placeras även av tredje part som vi har anlitat. I dokumentet nedan informerar vi dig om användningen av cookies på vår webbplats.','Legal document cookie policyRight to transfer your data: you have the right to request all your personal data from the controller and transfer it in its entirety to another controller.'=>'Rätt att överföra: du har rätt att begära alla dina personuppgifter från den registeransvarige och överföra den i sin helhet till en annan personuppgiftsansvarig.','Legal document cookie policySome cookies ensure that certain parts of the website work properly and that your user preferences remain known. By placing functional cookies, we make it easier for you to visit our website. This way, you do not need to repeatedly enter the same information when visiting our website and, for example, the items remain in your shopping cart until you have paid. We may place these cookies without your consent.'=>'Vissa cookies säkerställer att vissa delar av webbplatsen fungerar korrekt och att dina användarpreferenser förblir kända. Genom att placera funktionella cookies gör vi det enklare för dig att besöka och navigera på vår webbplats. På så sätt behöver du inte upprepade gånger ange samma information när du besöker vår hemsida och till exempel ligger varorna kvar i din varukorg tills du har betalat. Vi kan komma att placera dessa cookies utan ditt samtycke.','Legal document cookie policyTo exercise these rights, please contact us. Please refer to the contact details at the bottom of this Cookie Policy. If you have a complaint about how we handle your data, we would like to hear from you, but you also have the right to submit a complaint to the supervisory authority (the Data Protection Authority).'=>'För att utöva dessa rättigheter, vänligen kontakta oss. Se kontaktuppgifterna längst ner i denna cookiepolicy. Om du har ett klagomål på hur vi hanterar dina uppgifter vill vi gärna höra från dig, men du har även rätt att lämna in ett klagomål till tillsynsmyndigheten (Data Protection Authority).','Legal document cookie policyWe have made agreements about the use of cookies with other companies that place cookies. However, we cannot guarantee that these third parties handle your personal data in a reliable or secure manner. Parties such as Google are to be considered as independent data controllers. We recommend that you read the privacy statements of these companies.'=>'Vi har gjort överenskommelser om användningen av cookies med andra företag som placerar cookies. Vi kan dock inte garantera att dessa tredje parter hanterar dina personuppgifter på ett tillförlitligt eller säkert sätt. Parter som Google är att betrakta som oberoende personuppgiftsansvariga. Vi rekommenderar att du läser dessa företags sekretesspolicyer.','Legal document cookie policyWhen you visit our website for the first time, we will show you a pop-up with an explanation about cookies. As soon as you click on "%s", you consent to us using all cookies and plug-ins as described in the pop-up and this Cookie Policy. You can disable the use of cookies via your browser, but please note that our website may no longer work 